import React, { Fragment, useEffect, useState } from 'react';
import marvel from '../../services/instance';

const Home = () => {
  const [series, setSeries] = useState([]);

  useEffect(() => {
    marvel.get('/series').then(newSeries => {
      console.log(newSeries);
      setSeries(newSeries.data.data.results);
    });
  });

  return <p>{JSON.stringify(series)}</p>;
};
export default Home;
